import React, { useEffect, useState } from "react";
import styles from "../../styles/cabinet/CabinetNewTest.module.css";

const CabinetNewTest = ({ onTabChange }) => {
  const handleTabChange = (tab) => {
    onTabChange(tab);
  };

  return (
    <>
      <h2>Новий тест</h2>
      <button className={styles.newQuestionButton}>+ Додати запитання</button>
      <ul className={styles.questionsList}>
        <li>
          <input type="text" placeholder="Введіть запитання" />
          <ul className={styles.answersList}>
            <li>Bo</li>
            <button className={styles.newQuestionButton}>
              + Додати відповідь
            </button>
          </ul>
        </li>
      </ul>
      <button
        className={styles.backButton}
        onClick={() => handleTabChange("tests")}
      >
        Назад
      </button>
    </>
  );
};

export default CabinetNewTest;
